import React, { Component } from 'react';
import { StarWars } from './Swapi.js';
import logo from './droideka.png';
import './App.css';


const MyObject = {
  'name': 'Dan',
  game: 'halo reach'
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
            <StarWars/>
        </header>
      </div>
    );
  }
}

export default App;
